    font-size: 40px;
    color: red;
`;

const Container = styled.div`
    margin: 10px;
    color: red;
`;

const Header3 = () => {
    return (
        <div>
            <Title>This is header tree</Title>
            <Container>
                <h3>This is container head</h3>
                <p>This </p>
            </Container>
        </div>
    );
};

export default Header3;
